import React from 'react';

const contactUs = (props) => {
	return (
		<div>
			<h1>Contact Us</h1>
			<div>You may call us at 800.888.8888</div>
			<div>Or contact us at info@example.com</div>
		</div>
	);
};

export default contactUs;
